import Login from '@pages/login';
import Register from '@pages/register';
import Home from '@pages/home';
import UserInfo from '@pages/userInfo';
import Transform from '@pages/transform';
import Consignment from '@pages/consignment';
import ConsignmentRecord from '@pages/consignmentRecord';
import TimeMission from '@pages/timeMission';
import OffTimer from '@pages/offTimer';
import Banks from '@pages/banks';
import AddBank from '@pages/addBank';
import Password from '@pages/password';
import Bills from '@pages/bills';
import Activation from '@pages/activation';


const routeMap = [
  // 首页
  {
    path: "/",
    name: "home",
    component: Home,
    exact: true,
    auth: true,
  },
  // 登录
  {
    path: "/login",
    name: "login",
    component: Login,
    auth: false,
  },
  // 注册
  {
    path: "/register",
    name: "register",
    component: Register,
    auth: false,
  },

  // 个人中心
  {
    path: "/userInfo",
    name: "userInfo",
    component: UserInfo,
    auth: true,
  },
  //转账 
  {
    path: "/transform",
    name: "transform",
    component: Transform,
    auth: true,
  },
  //转账 
  {
    path: "/consignment",
    name: "consignment",
    component: Consignment,
    auth: true,
  },
  //代售记录
  {
    path: "/consignmentRecord",
    name: "consignmentRecord",
    component: ConsignmentRecord,
    auth: true,
  },
  //限时任务
  {
    path: "/timeMission",
    name: "timeMission",
    component: TimeMission,
    auth: true,
  },
  //取消显示任务
  {
    path: "/offTimer",
    name: "offTimer",
    component: OffTimer,
    auth: false,
  },
  //银行卡
  {
    path: "/banks",
    name: "banks",
    component: Banks,
    auth: true,
  },
  //添加银行卡
  {
    path: "/addBank",
    name: "addBank",
    component: AddBank,
    auth: true,
  },
  //密码
  {
    path: "/password",
    name: "password",
    component: Password,
    auth: true,
  },
  //账单
  {
    path: "/bills",
    name: "bills",
    component: Bills,
    auth: true,
  },
  //激活
  {
    path: "/activation",
    name: "activation",
    component: Activation,
    auth: false,
  },
]
export default routeMap
